import SCC_EQUATION_ENGINE:*;
import U_PT_LOG4J:Loggers:*;
import U_PT_ASSOC_ARRAY:*;

Global Record &recBudgetCategoryEqCfg;
Global boolean &boolLogBudgetEquationChange, &boolBudgetItemCodeAssignedbyEquation, &boolNewAmtByNewItemCode;
Global number &numPrcsInstance;

Local SCC_EQUATION_ENGINE:Equation &objEqtn;
Local SCC_EQUATION_ENGINE:Equation_Space &objEqtnSpace;
Local array of any &aryGlobalValue;
Local string &strNewItemCd;
Local U_PT_LOG4J:Loggers:DatabaseLogger &objLogger;
Local Record &recBudgetItemPSCfg, &recBudgetTermStage;

&boolBudgetItemCodeAssignedbyEquation = False;
&boolNewAmtByNewItemCode = False;
&recBudgetCategoryEqCfg = CreateRecord(Record.U_FA_BCATEQ_CFG);
&recBudgetCategoryEqCfg.INSTITUTION.Value = U_FA_BUDEQ_AET.INSTITUTION;
&recBudgetCategoryEqCfg.ACAD_CAREER.Value = U_FA_BUDEQS_AET.ACAD_CAREER.Value;
&recBudgetCategoryEqCfg.AID_YEAR.Value = U_FA_BUDEQ_AET.AID_YEAR;
&recBudgetCategoryEqCfg.BGT_ITEM_CATEGORY.Value = U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY;
&recBudgetCategoryEqCfg.SelectByKey();

&objLogger = create U_PT_LOG4J:Loggers:DatabaseLogger("BUDEQ");
&objLogger.debug("=============================================================");
&objLogger.debug("Emplid:" | U_FA_BUDEQS_AET.EMPLID.Value | " Strm:" | U_FA_BUDEQS_AET.STRM.Value | " Bdgt Cat:" | U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY.Value | " Bdgt Item:" | U_FA_BUDEQS_AET.BUDGET_ITEM_CD.Value);
&boolLogBudgetEquationChange = False;

/* If an equation exists, call the equation. */
If All(&recBudgetCategoryEqCfg.U_FA_BUDCAT_EQTN.Value) And
      All(&recBudgetCategoryEqCfg.BGT_ITEM_CATEGORY.Value) Then
   &objLogger.debug("Equation to be processed:" | &recBudgetCategoryEqCfg.U_FA_BUDCAT_EQTN.Value | "|");
   &objEqtnSpace = create SCC_EQUATION_ENGINE:Equation_Space();
   &objEqtnSpace.sName = &recBudgetCategoryEqCfg.U_FA_BUDCAT_EQTN.Value;
   &objEqtnSpace.ClearGlobals();
   &objEqtnSpace.SetGlobal("EMPLID", "String", U_FA_BUDEQS_AET.EMPLID.Value);
   &objEqtnSpace.SetGlobal("AID_YEAR", "String", U_FA_BUDEQS_AET.AID_YEAR.Value);
   &objEqtnSpace.SetGlobal("ACAD_CAREER", "String", U_FA_BUDEQS_AET.ACAD_CAREER.Value);
   &objEqtnSpace.SetGlobal("INSTITUTION", "String", U_FA_BUDEQS_AET.INSTITUTION.Value);
   &objEqtnSpace.SetGlobal("STRM", "String", U_FA_BUDEQS_AET.STRM.Value);
   &objEqtnSpace.SetGlobal("PROCESSING_MODE", "String", U_FA_BUDEQ_AET.PROCESSING_MODE.Value);
   &objEqtnSpace.SetGlobal("BGT_ITEM_CATEGORY", "String", U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY.Value);

   &objEqtn = create SCC_EQUATION_ENGINE:Equation();
   &objEqtn.sName = &recBudgetCategoryEqCfg.U_FA_BUDCAT_EQTN.Value;
   &objEqtn.sGlobalArrayLocation = "PARMS";
   &objEqtn.bLogInfoMsgs = True;
   &objEqtn.iProcessInstance = &numPrcsInstance;
   &objEqtn.sRunControlID = U_FA_BUDEQ_AET.RUN_CNTL_ID;
   CommitWork();
   try

      &objEqtn.Execute();
   catch SCC_EQUATION_ENGINE:Equation_Exception &eqxFanEqtnException;
      &objLogger.debug("Equation in catch section." | " ErrMsg:" | String(&objEqtn.iMessageNumber) | "|" | String(&objEqtn.iMessageSet));
      MessageBox(0, "", 0, 0, String(&objEqtn.iMessageNumber));
   end-try;

   &objEqtnSpace = create SCC_EQUATION_ENGINE:Equation_Space();
   &objEqtnSpace.sName = &recBudgetCategoryEqCfg.U_FA_BUDCAT_EQTN.Value;
   &objLogger.debug("Equation Space:" | &objEqtnSpace.sName);
   &aryGlobalValue = CreateArrayAny();
   &aryGlobalValue = &objEqtnSpace.GetGlobal("U_B_ITEM_CD");
   &strNewItemCd = &aryGlobalValue [2];
   /* BEGIN UWMSN Eric Gentz  2/11/2016 */
   If All(&strNewItemCd) Then
      &boolLogBudgetEquationChange = True;
      &boolBudgetItemCodeAssignedbyEquation = True;
   Else
      &boolLogBudgetEquationChange = False;
      &boolBudgetItemCodeAssignedbyEquation = False;
   End-If;
   /* END UWMSN Eric Gentz 2/11/2016 */
   &objLogger.debug("Calculated budget item code:" | &strNewItemCd | " Found budget item:" | &boolBudgetItemCodeAssignedbyEquation);
   U_FA_BUDEQS_AET.U_FA_NEW_BUDITEM = &strNewItemCd;
   /* If a new budget item code is calculated, find the amount from the setup table. */
   &recBudgetItemPSCfg = CreateRecord(Record.BUDGET_ITEM_TBL);
   &recBudgetItemPSCfg.INSTITUTION.Value = U_FA_BUDEQS_AET.INSTITUTION;
   &recBudgetItemPSCfg.AID_YEAR.Value = U_FA_BUDEQS_AET.AID_YEAR;
   &recBudgetItemPSCfg.BGT_ITEM_CATEGORY.Value = U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY;
   &recBudgetItemPSCfg.BUDGET_ITEM_CD.Value = U_FA_BUDEQS_AET.U_FA_NEW_BUDITEM;
   &recBudgetItemPSCfg.SelectByKey();
   U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = 0;
   If &boolBudgetItemCodeAssignedbyEquation Then
      If &recBudgetItemPSCfg.BUDG_MULTIPLIER.Value = "N" Then
         U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = &recBudgetItemPSCfg.BUDGET_ITEM_AMOUNT.Value;
         &boolEquationAmountDifference = True;
         &boolNewAmtByNewItemCode = True;
      Else
         &recBudgetTermStage = CreateRecord(Record.STDNT_BDGT_ASGN);
         &recBudgetTermStage.EMPLID.Value = U_FA_BUDEQS_AET.EMPLID;
         &recBudgetTermStage.INSTITUTION.Value = U_FA_BUDEQS_AET.INSTITUTION;
         &recBudgetTermStage.AID_YEAR.Value = U_FA_BUDEQS_AET.AID_YEAR;
         &recBudgetTermStage.STRM.Value = U_FA_BUDEQS_AET.STRM;
         &recBudgetTermStage.PROCESSING_MODE.Value = U_FA_BUDEQ_AET.PROCESSING_MODE;
         &recBudgetTermStage.SelectByKey();
         &objLogger.debug("Bdgt Mult Field:" | &recBudgetItemPSCfg.BUDG_MULT_FIELD.Value | " Per Unit:" | String(&recBudgetItemPSCfg.BUDGET_ITEM_AMOUNT.Value));
         &numBudgetItemMultAmt = &recBudgetTermStage.GetField(@("FIELD." | &recBudgetItemPSCfg.BUDG_MULT_FIELD.Value)).Value * &recBudgetItemPSCfg.BUDGET_ITEM_AMOUNT.Value;
         U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = &numBudgetItemMultAmt;
         &objLogger.debug("Final Amt:" | String(&numBudgetItemMultAmt));
         &boolEquationAmountDifference = True;
         &boolNewAmtByNewItemCode = True;
      End-If;
      &objLogger.debug("Calculated budget item code:" | &strNewItemCd | " AryLen:" | String(&aryGlobalValue.Len) | "|");
   End-If;

End-If;
/* END UWMSN Eric Gentz 5/7/2015 */

/*
UWMSN DOCUMENTATION
     DATE:                2/11/2016
     OWNER ID:            Financial Aid                               
     DEVELOPER:           Eric Gentz        
     SUPPORTING DOCUMENT: FINAID-1247             
     COMMENTS:            Fixed issue with erroneous budget item assignment.

