/* BEGIN UWMSN Eric Gentz 5/7/2015 */
import SCC_EQUATION_ENGINE:*;
import U_PT_LOG4J:Loggers:*;
import U_PT_ASSOC_ARRAY:*;

Global Record &recBudgetCategoryEqCfg;
Global Record &recBudgetItemCfg;
Global boolean &boolLogBudgetEquationChange, &boolBudgetItemCodeAssignedbyEquation, &boolNewAmtByNewItemCode;
Global number &numPrcsInstance;

Local SCC_EQUATION_ENGINE:Equation &objEqtn;
Local SCC_EQUATION_ENGINE:Equation_Space &objEqtnSpace;
Local array of any &aryGlobalValue;
Local string &strNewItemCd;
Local U_PT_LOG4J:Loggers:DatabaseLogger &objLogger;
Local boolean &boolAssignBudgetItem, &boolRemoveBudgetItemCode, &boolEquationAmountDifference;
Local number &numNewBudgetItemAmt, &numBudgetItemMultAmt;
Local Record &recBudgetItemPSCfg, &recBudgetTermStage, &recBudgetItemStage;

&objLogger = create U_PT_LOG4J:Loggers:DatabaseLogger("BUDEQ");

&recBudgetItemCfg = CreateRecord(Record.U_FA_BITMEQ_CFG);
&recBudgetItemCfg.INSTITUTION.Value = U_FA_BUDEQS_AET.INSTITUTION;
&recBudgetItemCfg.AID_YEAR.Value = U_FA_BUDEQS_AET.AID_YEAR;
&recBudgetItemCfg.ACAD_CAREER.Value = U_FA_BUDEQS_AET.ACAD_CAREER;
&recBudgetItemCfg.BGT_ITEM_CATEGORY.Value = U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY;

If &boolBudgetItemCodeAssignedbyEquation Then
   &recBudgetItemCfg.BUDGET_ITEM_CD.Value = U_FA_BUDEQS_AET.U_FA_NEW_BUDITEM;
Else
   &recBudgetItemCfg.BUDGET_ITEM_CD.Value = U_FA_BUDEQS_AET.BUDGET_ITEM_CD;
End-If;
&objLogger.debug("Using item code:" | &recBudgetItemCfg.BUDGET_ITEM_CD.Value);
&recBudgetItemCfg.SelectByKey();
&objLogger.debug("Use Item Eq:" | &recBudgetItemCfg.U_FA_AUTO_BDGT_ITM.Value | " Use Amt Eq:" | &recBudgetItemCfg.U_FA_USE_BDGT_ITEM.Value | "Budget Item to be Processed:" | &recBudgetItemCfg.BUDGET_ITEM_CD.Value | " Orig Bud Item:" | U_FA_BUDEQS_AET.BUDGET_ITEM_CD);
&objLogger.debug("Amt Eq:" | &recBudgetItemCfg.U_FA_BUDITMA_EQTN.Value);
/* Budget Select Equation */
If All(&recBudgetItemCfg.U_FA_BUDITMS_EQTN.Value) And
      &recBudgetItemCfg.U_FA_AUTO_BDGT_ITM.Value = "N" Then
   &objLogger.debug("Processing budget item equation");
   &boolAssignBudgetItem = False;
   &objEqtnSpace = create SCC_EQUATION_ENGINE:Equation_Space();
   &objEqtnSpace.sName = &recBudgetItemCfg.U_FA_BUDITMS_EQTN.Value;
   &objEqtnSpace.ClearGlobals();
   &objEqtnSpace.SetGlobal("EMPLID", "String", U_FA_BUDEQS_AET.EMPLID.Value);
   &objEqtnSpace.SetGlobal("AID_YEAR", "String", U_FA_BUDEQS_AET.AID_YEAR.Value);
   &objEqtnSpace.SetGlobal("INSTITUTION", "String", U_FA_BUDEQS_AET.INSTITUTION.Value);
   &objEqtnSpace.SetGlobal("ACAD_CAREER", "String", U_FA_BUDEQS_AET.ACAD_CAREER.Value);
   &objEqtnSpace.SetGlobal("STRM", "String", U_FA_BUDEQS_AET.STRM.Value);
   &objEqtnSpace.SetGlobal("PROCESSING_MODE", "String", U_FA_BUDEQ_AET.PROCESSING_MODE.Value);
   &objEqtnSpace.SetGlobal("BGT_ITEM_CATEGORY", "String", U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY.Value);

   &objEqtn = create SCC_EQUATION_ENGINE:Equation();
   &objEqtn.sName = &recBudgetItemCfg.U_FA_BUDITMS_EQTN.Value;
   &objEqtn.sGlobalArrayLocation = "PARMS";
   &objEqtn.bLogInfoMsgs = True;
   &objEqtn.iProcessInstance = &numPrcsInstance;
   &objEqtn.sRunControlID = U_FA_BUDEQ_AET.RUN_CNTL_ID;

   CommitWork();

   try

      &objEqtn.Execute();
   catch SCC_EQUATION_ENGINE:Equation_Exception &eqxFanEqtnException;
      &objLogger.fatal("Equation in catch section." | " ErrMsg:" | String(&objEqtn.iMessageNumber) | "|" | String(&objEqtn.iMessageSet));
      MessageBox(0, "", 0, 0, String(&objEqtn.iMessageNumber));
   end-try;
   &objEqtnSpace = create SCC_EQUATION_ENGINE:Equation_Space();
   &objEqtnSpace.sName = &recBudgetItemCfg.U_FA_BUDITMS_EQTN.Value;
   &aryGlobalValue = CreateArrayAny();
   &aryGlobalValue = &objEqtnSpace.GetGlobal("U_B_SELECT");
   If &aryGlobalValue [2] = "Y" Then
      &boolAssignBudgetItem = True;
      &boolLogBudgetEquationChange = True;
   End-If;
Else
   /* BEGIN UWMSN Eric Gentz 2/11/2016 */
   /*   If &recBudgetItemCfg.U_FA_AUTO_BDGT_ITM.Value = "Y" And
         &boolBudgetItemCodeAssignedbyEquation Then*/
   &boolRemoveBudgetItemCode = False;
   /*  Else
      &boolRemoveBudgetItemCode = True;
   End-If;*/
   /* END UWMSN Eric Gentz 2/11/2016 */
End-If;

/* Budget Amount Equation */
If All(&recBudgetItemCfg.U_FA_BUDITMA_EQTN.Value) And
      &recBudgetItemCfg.U_FA_USE_BDGT_ITEM.Value = "N" Then

   &objLogger.debug("Processing budget amount equation. " | &recBudgetItemCfg.U_FA_BUDITMA_EQTN.Value);
   &recBudgetItemStage = CreateRecord(Record.STDNT_ITEM_ASGN);
   &recBudgetItemStage.EMPLID.Value = U_FA_BUDEQS_AET.EMPLID;
   &recBudgetItemStage.INSTITUTION.Value = U_FA_BUDEQS_AET.INSTITUTION;
   &recBudgetItemStage.AID_YEAR.Value = U_FA_BUDEQS_AET.AID_YEAR;
   &recBudgetItemStage.STRM.Value = U_FA_BUDEQS_AET.STRM;
   &recBudgetItemStage.PROCESSING_MODE.Value = U_FA_BUDEQ_AET.PROCESSING_MODE;
   &recBudgetItemStage.BGT_ITEM_CATEGORY.Value = U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY;
   &recBudgetItemStage.SelectByKey();

   &objEqtnSpace = create SCC_EQUATION_ENGINE:Equation_Space();
   &objEqtnSpace.sName = &recBudgetItemCfg.U_FA_BUDITMA_EQTN.Value;
   &objEqtnSpace.ClearGlobals();
   &objEqtnSpace.SetGlobal("EMPLID", "String", U_FA_BUDEQS_AET.EMPLID.Value);
   &objEqtnSpace.SetGlobal("AID_YEAR", "String", U_FA_BUDEQS_AET.AID_YEAR.Value);
   &objEqtnSpace.SetGlobal("ACAD_CAREER", "String", U_FA_BUDEQS_AET.ACAD_CAREER.Value);
   &objEqtnSpace.SetGlobal("INSTITUTION", "String", U_FA_BUDEQS_AET.INSTITUTION.Value);
   &objEqtnSpace.SetGlobal("STRM", "String", U_FA_BUDEQS_AET.STRM.Value);
   &objEqtnSpace.SetGlobal("PROCESSING_MODE", "String", U_FA_BUDEQ_AET.PROCESSING_MODE.Value);
   &objEqtnSpace.SetGlobal("BGT_ITEM_CATEGORY", "String", U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY.Value);
   If &boolNewAmtByNewItemCode Then
      &objEqtnSpace.SetGlobal("U_B_AMOUNT", "Number", U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT);
   Else
      &objEqtnSpace.SetGlobal("U_B_AMOUNT", "Number", &recBudgetItemStage.BUDGET_ITEM_AMOUNT.Value);
   End-If;
   /* BEGIN UWMSN Eric Gentz 3/3/2016 */
   If &boolBudgetItemCodeAssignedbyEquation Then
      &objEqtnSpace.SetGlobal("U_BUDGET_ITEM_CODE", "String", U_FA_BUDEQS_AET.U_FA_NEW_BUDITEM);
   End-If;
   /* END UWMSN Eric Gentz 3/3/2016 */

   &objEqtn = create SCC_EQUATION_ENGINE:Equation();
   &objEqtn.sName = &recBudgetItemCfg.U_FA_BUDITMA_EQTN.Value;
   &objEqtn.sGlobalArrayLocation = "PARMS";
   &objEqtn.bLogInfoMsgs = True;
   &objEqtn.iProcessInstance = &numPrcsInstance;
   &objEqtn.sRunControlID = U_FA_BUDEQ_AET.RUN_CNTL_ID;
   CommitWork();
   try

      &objEqtn.Execute();
   catch SCC_EQUATION_ENGINE:Equation_Exception &eqxFanEqtnException2;
      &objLogger.debug("Equation in catch section." | " ErrMsg:" | String(&objEqtn.iMessageNumber) | "|" | String(&objEqtn.iMessageSet));
      MessageBox(0, "", 0, 0, String(&objEqtn.iMessageNumber));
   end-try;
   &objEqtnSpace = create SCC_EQUATION_ENGINE:Equation_Space();
   &objEqtnSpace.sName = &recBudgetItemCfg.U_FA_BUDITMA_EQTN.Value;
   &aryGlobalValue = CreateArrayAny();
   &aryGlobalValue = &objEqtnSpace.GetGlobal("U_B_AMOUNT");
   &numNewBudgetItemAmt = Value(&aryGlobalValue [2]);
   &objLogger.debug("Calced Amt:" | String(&numNewBudgetItemAmt));
   Evaluate &recBudgetItemCfg.U_FA_BAMT_ACTION.Value
   When = "R"
      U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = &numNewBudgetItemAmt;
      Break;
   When = "I"
      U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT + &numNewBudgetItemAmt;
      Break;
   When = "D"
      U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT - &numNewBudgetItemAmt;
      Break;
   End-Evaluate;
   &boolLogBudgetEquationChange = True;
   /* BEGIN UWMSN Eric Gentz 2/11/2016 */
   If U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT <> &recBudgetItemStage.BUDGET_ITEM_AMOUNT.Value Then
      &boolEquationAmountDifference = True;
   Else
      &boolEquationAmountDifference = False;
   End-If;
   /* END UWMSN Eric Gentz 2/11/2016 */
Else
   If &boolAssignBudgetItem And
         &recBudgetItemCfg.U_FA_USE_BDGT_ITEM.Value = "Y" Then
      &recBudgetItemPSCfg = CreateRecord(Record.BUDGET_ITEM_TBL);
      &recBudgetItemPSCfg.INSTITUTION.Value = U_FA_BUDEQS_AET.INSTITUTION;
      &recBudgetItemPSCfg.AID_YEAR.Value = U_FA_BUDEQS_AET.AID_YEAR;
      &recBudgetItemPSCfg.BGT_ITEM_CATEGORY.Value = U_FA_BUDEQS_AET.BGT_ITEM_CATEGORY;
      &recBudgetItemPSCfg.BUDGET_ITEM_CD.Value = U_FA_BUDEQS_AET.BUDGET_ITEM_CD;
      &recBudgetItemPSCfg.SelectByKey();
      If &recBudgetItemPSCfg.BUDG_MULTIPLIER.Value = "N" Then
         If U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT <> &recBudgetItemPSCfg.BUDGET_ITEM_AMOUNT.Value Then
            U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = &recBudgetItemPSCfg.BUDGET_ITEM_AMOUNT.Value;
            &objLogger.debug("New Amt by Cfg:" | String(U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT));
            &boolEquationAmountDifference = True;
         Else
            &boolEquationAmountDifference = False;
         End-If;
      Else
         &recBudgetTermStage = CreateRecord(Record.STDNT_BDGT_ASGN);
         &recBudgetTermStage.EMPLID.Value = U_FA_BUDEQS_AET.EMPLID;
         &recBudgetTermStage.INSTITUTION.Value = U_FA_BUDEQS_AET.INSTITUTION;
         &recBudgetTermStage.AID_YEAR.Value = U_FA_BUDEQS_AET.AID_YEAR;
         &recBudgetTermStage.STRM.Value = U_FA_BUDEQS_AET.STRM;
         &recBudgetTermStage.SelectByKey();
         &numBudgetItemMultAmt = &recBudgetTermStage.GetField(@("FIELD." | &recBudgetItemPSCfg.BUDG_MULT_FIELD.Value)).Value * &recBudgetItemPSCfg.BUDGET_ITEM_AMOUNT.Value;
         &objLogger.debug("New Amt by Mult:" | String(&numBudgetItemMultAmt));
         If U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT <> &numBudgetItemMultAmt Then
            U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT = &numBudgetItemMultAmt;
            &boolEquationAmountDifference = True
         Else
            &boolEquationAmountDifference = False;
         End-If;
      End-If;
   End-If;
   If &boolRemoveBudgetItemCode Then
      &objLogger.debug("Delete codes and amounts.");
      U_FA_BUDEQS_AET.BUDGET_ITEM_CD = " ";
      U_FA_BUDEQS_AET.BUDGET_ITEM_AMOUNT = 0;
   End-If;
End-If;
/* If the new budget item amount is the same as the original, and there are no other budget equation changes, the staging table and log table should not be updated. */
&objLogger.debug("Amount Diff:" | &boolEquationAmountDifference | " Assign Budget Item:" | &boolAssignBudgetItem | " Log Eqtn Change:" | &boolLogBudgetEquationChange | " Item Assigned by Equation:" | &boolBudgetItemCodeAssignedbyEquation);
&objLogger.debug("Final New Amt:" | String(U_FA_BUDEQS_AET.U_FA_NEW_BUDITMAMT));
If Not &boolEquationAmountDifference And
      Not &boolBudgetItemCodeAssignedbyEquation And
      Not &boolAssignBudgetItem And
      &boolLogBudgetEquationChange Then
   &boolLogBudgetEquationChange = False;
End-If;

/* END UWMSN Eric Gentz 5/7/2015 */

