	COMMENTS:				Defines the log4j level for the other logger classes. The class provides methods for setting the log level and determining the current log level.
*/

/* BEGIN UWMSN E4G 9/12/2012 */

class Level
   method enableForFatal() Returns U_PT_LOG4J:Level;
   method enableForDebug() Returns U_PT_LOG4J:Level;
   method enableForWarn() Returns U_PT_LOG4J:Level;
   method enableForInfo() Returns U_PT_LOG4J:Level;
   method enableFor(&descr As string, &level As number) Returns U_PT_LOG4J:Level;
   method enableFromNumber(&level As number) Returns U_PT_LOG4J:Level;
   method enableFromString(&level As string) Returns U_PT_LOG4J:Level;

   method toNumber() Returns number;
   method toString() Returns string;

   method isFatalEnabled() Returns boolean;
   method isDebugEnabled() Returns boolean;
   method isWarnEnabled() Returns boolean;
   method isInfoEnabled() Returns boolean;
   method isEnabledFor(&level As U_PT_LOG4J:Level) Returns boolean;



private
   Constant &LEVEL_FATAL = 500;
   Constant &LEVEL_WARN = 400;
   Constant &LEVEL_DEBUG = 200;
   Constant &LEVEL_INFO = 300;
   Constant &LEVEL_FATAL_DESCR = "FATAL";
   Constant &LEVEL_DEBUG_DESCR = "DEBUG";
   Constant &LEVEL_WARN_DESCR = "WARN";
   Constant &LEVEL_INFO_DESCR = "INFO";

   instance number &levelNumber_;
   instance string &levelDescr_;

   method setLevel(&descr As string, &nbr As number) Returns U_PT_LOG4J:Level;

end-class;

method enableForFatal
   /+ Returns U_PT_LOG4J:Level +/
   Return %This.setLevel(&LEVEL_FATAL_DESCR, &LEVEL_FATAL);
end-method;

method enableForDebug
   /+ Returns U_PT_LOG4J:Level +/
   Return %This.setLevel(&LEVEL_DEBUG_DESCR, &LEVEL_DEBUG);
end-method;

method enableForWarn
   /+ Returns U_PT_LOG4J:Level +/
   Return %This.setLevel(&LEVEL_DEBUG_DESCR, &LEVEL_DEBUG);
end-method;

method enableForInfo
   /+ Returns U_PT_LOG4J:Level +/
   Return %This.setLevel(&LEVEL_INFO_DESCR, &LEVEL_INFO);
end-method;

method enableFor
   /+ &descr as String, +/
   /+ &level as Number +/
   /+ Returns U_PT_LOG4J:Level +/
   Return %This.setLevel(&descr, &level);
end-method;

method enableFromNumber
   /+ &level as Number +/
   /+ Returns U_PT_LOG4J:Level +/
   Local U_PT_LOG4J:Level &this;

   Evaluate &level
   When = &LEVEL_FATAL
      &this = %This.enableForFatal();
   When = &LEVEL_DEBUG
      &this = %This.enableForDebug();
   When = &LEVEL_WARN
      &this = %This.enableForWarn();
   When = &LEVEL_INFO
      &this = %This.enableForInfo();
   When-Other
      &this = %This.enableFor("UNKNOWN", &level);
   End-Evaluate;

   Return %This;
end-method;

method enableFromString
   /+ &level as String +/
   /+ Returns U_PT_LOG4J:Level +/
   Local U_PT_LOG4J:Level &this;

   Evaluate &level
   When = &LEVEL_FATAL_DESCR
      &this = %This.enableForFatal();
   When = &LEVEL_DEBUG_DESCR
      &this = %This.enableForDebug();
   When = &LEVEL_WARN_DESCR
      &this = %This.enableForWarn();
   When = &LEVEL_INFO_DESCR
      &this = %This.enableForInfo();
   When-Other
      &this = %This.enableFor("UNKNOWN", 999);
   End-Evaluate;

   Return %This;
end-method;

method isFatalEnabled
   /+ Returns Boolean +/
   Return (&LEVEL_FATAL >= %This.toNumber());
end-method;

method isDebugEnabled
   /+ Returns Boolean +/
   Return (&LEVEL_DEBUG >= %This.toNumber());
end-method;

method isWarnEnabled
   /+ Returns Boolean +/
   Return (&LEVEL_WARN >= %This.toNumber());
end-method;

method isInfoEnabled
   /+ Returns Boolean +/
   Return (&LEVEL_INFO >= %This.toNumber());
end-method;

method isEnabledFor
   /+ &level as U_PT_LOG4J:Level +/
   /+ Returns Boolean +/
   Return (&level.toNumber() >= %This.toNumber());
end-method;

method toString
   /+ Returns String +/
   Return &levelDescr_;
end-method;


method toNumber
   /+ Returns Number +/
   Return &levelNumber_;
end-method;

method setLevel
   /+ &descr as String, +/
   /+ &nbr as Number +/
   /+ Returns U_PT_LOG4J:Level +/
   &levelDescr_ = &descr;
   &levelNumber_ = &nbr;
   Return %This;
end-method;

/* END UWMSN E4G 9/12/2012 */

