import U_PT_LOG4J:Level;

interface Logger
   /* Statement logging methods, one for each level */
   method fatal(&msg As string);
   method warn(&msg As string);
   method debug(&msg As string);
   method info(&msg As string);

   /* Convenience methods for determining the current log level */
   method isFatalEnabled() Returns boolean;
   method isDebugEnabled() Returns boolean;
   method isWarnEnabled() Returns boolean;
   method isInfoEnabled() Returns boolean;
   method isEnabledFor(&level As U_PT_LOG4J:Level) Returns boolean;

   method setLevel(&level As U_PT_LOG4J:Level);
end-interface;

/* END UWMSN E4G 9/12/2012 */

/* 
UWMSN DOCUMENTATION
	DATE:					9/12/2012
	OWNER ID:				Financial Aid  						
	DEVELOPER:				E4G		
	SUPPORTING DOCUMENT:	FINAID-684			
	COMMENTS:				The base logger class provides generic methods for writing to a log. Other methods implement this base method to write to a specific type of log.
*/

/* BEGIN UWMSN E4G 9/12/2012 */
import U_PT_LOG4J:Loggers:Logger;
import U_PT_LOG4J:Level;

class LoggerBase implements U_PT_LOG4J:Loggers:Logger
   property string strLogName;
   property string strRecName;

   method LoggerBase(&inLogName As string);

   REM ** Statement logging methods, one for each level;
   method fatal(&msg As string);
   method debug(&msg As string);
   method warn(&msg As string);
   method info(&msg As string);

   REM ** Convenience methods to determine the current log level;
   method isFatalEnabled() Returns boolean;
   method isInfoEnabled() Returns boolean;
   method isDebugEnabled() Returns boolean;
   method isWarnEnabled() Returns boolean;
   method isEnabledFor(&level As U_PT_LOG4J:Level) Returns boolean;


   method setLevel(&level As U_PT_LOG4J:Level);

protected
   method writeToLog(&level As U_PT_LOG4J:Level, &msg As string) abstract;

private
   instance U_PT_LOG4J:Level &level_;


end-class;

method LoggerBase
   /+ &inLogName as String +/
   Local Record &recLogSettings;
   %This.strLogName = &inLogName;
   &recLogSettings = CreateRecord(Record.U_PT_LOG_CONFIG);
   &recLogSettings.U_PT_LOGNAME.Value = %This.strLogName;
   &recLogSettings.SelectByKey();
   &level_ = (create U_PT_LOG4J:Level()).enableFromString(&recLogSettings.U_PT_LOG_LEVL_DFLT.Value);
   &strRecName = &recLogSettings.RECNAME.Value;
end-method;

method fatal
   /+ &msg as String +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.fatal +/
   If (%This.isFatalEnabled()) Then
      %This.writeToLog((create U_PT_LOG4J:Level()).enableForFatal(), &msg);
   End-If;
end-method;

method info
   /+ &msg as String +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.info +/
   If (%This.isInfoEnabled()) Then
      %This.writeToLog((create U_PT_LOG4J:Level()).enableForInfo(), &msg);
   End-If;
end-method;


method warn
   /+ &msg as String +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.warn +/
   If (%This.isWarnEnabled()) Then
      %This.writeToLog((create U_PT_LOG4J:Level()).enableForWarn(), &msg);
   End-If;
end-method;

method debug
   /+ &msg as String +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.debug +/
   If (%This.isDebugEnabled()) Then
      %This.writeToLog((create U_PT_LOG4J:Level()).enableForDebug(), &msg);
   End-If;
end-method;

REM ** Convenience methods to determine the current log level;
method isFatalEnabled
   /+ Returns Boolean +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.isFatalEnabled +/
   Return &level_.isFatalEnabled();
end-method;

method isInfoEnabled
   /+ Returns Boolean +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.isInfoEnabled +/
   Return &level_.isInfoEnabled();
end-method;

method isWarnEnabled
   /+ Returns Boolean +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.isWarnEnabled +/
   Return &level_.isFatalEnabled();
end-method;

method isDebugEnabled
   /+ Returns Boolean +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.isDebugEnabled +/
   Return &level_.isDebugEnabled();
end-method;

method isEnabledFor
   /+ &level as U_PT_LOG4J:Level +/
   /+ Returns Boolean +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.isEnabledFor +/
   Return &level_.isEnabledFor(&level);
end-method;


method setLevel
   /+ &level as U_PT_LOG4J:Level +/
   /+ Extends/implements U_PT_LOG4J:Loggers:Logger.setLevel +/
   &level_ = &level;
end-method;


